or:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2236090","type":"CustomJS"},{"attributes":{"active_drag":{"id":"2235959"},"active_scroll":{"id":"2235960"},"tools":[{"id":"2235959"},{"id":"2235960"},{"id":"2235961"},{"id":"2235962"},{"id":"2235963"},{"id":"2235964"},{"id":"2235965"},{"id":"2235982"},{"id":"2236091"}]},"id":"2235967","type":"Toolbar"},{"attributes":{},"id":"2235726","type":"RedoTool"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/g/9bZmTi7z/dv4HiKjvwP3hRZahrLfA/9toNzX5G8D8jyvvMIgLwP31yEPo2ae8/L3Zyl1eW7j/9/QySLlTuP/Pvn4Go4e0/OSSAgwRB7T89oW+Y0o3tP7hWsDid7uw/GBKI4EKq7D+CrAw5JvrsP0RIFTD+4Ow/CXih0uuT7D++GjgIQFHsPypR0Iaw7Os/PiKuIxzY6z/JLtY/obHrP5r3QY6Uaus/hTTyxVN56z8EY/I1rMrrP9mJDzSq4es/umY2WfWa6z9qM75zlGHrP4K2Yg6pKus/piL5lYl16z9Wbx69j0LrP9lOr0eyDes/wIV6L/u76j+RRfHCh5bqPzeX+tkOTeo/XDq03qQf6j/7Ys8B9j/qPxVcZtTdBeo/ivYJqWW36T9PEoydDZ3pP8NuV8l2h+k/vOkuFvA16T97Gbol9wzpP5/ya6Qb8+g/IDhUz+vv6D+rIll2d9PoPzG8MATGu+g/h2o99s266D+C62oMoEroP3FpUOdbBeg/KzFbh6q16D8k2ZvjVtTnP9RFr4fxMeg/BGmXs5rV5z8lolJW3wroP7jAKfQF
